import React from 'react';
import { Line } from 'react-chartjs-2'
import Chart from 'chart.js/auto'


    const data = {
        labels: ['Jan', 'Mar', 'May', 'July', 'Oct'],
        datasets: [
          {
            label: 'Iphone sales',
            data: [400, 1000, 4000, 800, 1500],
            fill: true,
            backgroundColor:"#2e4355",
            borderColor:"#2e4355",
          },
        ],
      };

      const options = {
        responsive: true,
        plugins: {
          legend: {
            position: 'top',
          },
          title: {
            display: true,
            text: 'Chart.js Line Chart',
          },
        },
      };

const Charts = () => {


    return (
        <div className="h-80">
            <h2 className="text-3xl text-center font-bold">Chart</h2>
            <div className="flex flex-row justify-center justify-around">
            <Line data={data} options={options}/>
            
            </div>
        </div>
    )
}

export default Charts
